const axios = require("axios");
const fs = require("fs");
const path = require("path");

const prefixes = ["moji"];

// set true to send banned message or false to remain silent
const SEND_BANNED_THREAD_MESSAGE = true;
const SEND_BANNED_USER_MESSAGE = true;

const personaNames = {
  0: "normal",
  1: "npc",
  2: "noble medieval",
  3: "humorous",
  4: "poet",
};

module.exports = {
  config: {
    name: "moji",
    version: "1.15.0",
    author: "Dainsleif",
    countDown: 5,
    role: 0,
    shortDescription: "ASK AI",
    longDescription: {
      en: "ASK AImoji",
    },
    category: "ai",
    guide: {
      en: "{prefix} ask anything ",
    },
  },
  onStart: async function ({ api, event, args, threadsData }) {
    const action = args[0]?.toLowerCase();
    const personaFile = path.join(__dirname, "persona.json");

    // Load existing persona data from the JSON file
    let personaData = [];
    if (fs.existsSync(personaFile)) {
      const data = fs.readFileSync(personaFile, "utf8");
      if (data) {
        personaData = JSON.parse(data);
      }
    }

    const userID = event.senderID;
    let userPersona = personaData.find((entry) => entry[userID]);

    if (!userPersona) {
      userPersona = { [userID]: 0 };
      personaData.push(userPersona);
    }

    if (!action || !isNaN(action)) {
      // Display available actions and their details
      const availableActions = [
        { action: "set", description: "Set your persona to a specific category.\n  /moji set [number from 1 to 4]" },
        { action: "view", description: "View your current persona.\n  -moji view" },
      ];

      let availableActionsMessage = "Available actions:\n";
      availableActions.forEach((item) => {
        availableActionsMessage += `${item.action}: ${item.description}\n`;
      });

      availableActionsMessage += `\n=>To trigger the command, simply use\n\n${prefixes.join(" or ")} [your query here without prefix]`;

      api.sendMessage(availableActionsMessage, event.threadID);
      return;
    }

    if (action === "set") {
      const newPersona = parseInt(args[1]);
      if (isNaN(newPersona) || newPersona < 0 || newPersona > 4) {
        api.sendMessage(`Invalid persona number. Please choose a number between 0 to 4.`, event.threadID);
        return;
      }

      userPersona[userID] = newPersona;
      fs.writeFileSync(personaFile, JSON.stringify(personaData, null, 2), "utf8");

      const personaName = personaNames[newPersona];
      api.sendMessage(`You have set your persona to: ${personaName} (${newPersona})`, event.threadID);

    } else if (action === "view") {
      const userPersonaID = userPersona[userID];
      const personaName = personaNames[userPersonaID];
      api.sendMessage(`Your current persona is: ${personaName} (${userPersonaID})`, event.threadID);
    } else {
      api.sendMessage(`Invalid action. Use 'set' or 'view'. \n=>To trigger the command, simply use\n\n${prefixes.join(" or ")} [your query here without prefix]`, event.threadID);
    }
  },

  onChat: async function ({ api, event, args, threadsData, usersData }) {
    try {
      if (!event || !event.body) {
        // Return or handle the error accordingly
        return;
      }

      const threadID = event.threadID;
      const threadData = await threadsData.get(threadID);

      const senderID = event.senderID;
      const userData = await usersData.get(senderID);

      const message = event.body.trim().toLowerCase();
      const words = message.split(" ");

      const hasPrefix = prefixes.some((prefix) => words[0] === prefix.toLowerCase());

      if (!hasPrefix || words.length <= 1) {
        if (hasPrefix) {
          return api.sendMessage("Please provide a question or query.", event.threadID, event.messageID);
        } else {
          return; // Do not respond if the first word is not a prefix.
        }
      }

      // Check if the thread is banned
      if (threadData && threadData.banned && threadData.banned.status === true) {
        if (args[0].toLowerCase() === "dain" || prefixes.includes(args[0].toLowerCase())) {
          if (SEND_BANNED_THREAD_MESSAGE) {
            const banReason = threadData.banned.reason || "No reason provided";
            const banDate = threadData.banned.date || "Unknown date";
            return api.sendMessage(`This thread is banned.\nReason: ${banReason}.\nDate: ${banDate}`, event.threadID);
          } else {
            return;
          }
        }
      }

      // Check if the user is banned
      if (userData && userData.banned && userData.banned.status === true) {
        if (args[0].toLowerCase() === "dain" || prefixes.includes(args[0].toLowerCase())) {
          if (SEND_BANNED_USER_MESSAGE) {
            const banReason = userData.banned.reason || "No reason provided";
            const banDate = userData.banned.date || "Unknown date";
            return api.sendMessage(`You are banned.\nReason: ${banReason}.\nDate: ${banDate}`, event.threadID);
          } else {
            return;
          }
        }
      }

      api.sendMessage("Searching for an answer, please wait...", event.threadID, event.messageID);

      const query = args.join(" ").slice(words[0].length + 1).trim();
      const userName = userData.name || "Unknown"; // Fallback to "Unknown" if name is not available
      const personaFile = path.join(__dirname, "persona.json");

      let personaData = [];
      if (fs.existsSync(personaFile)) {
        const data = fs.readFileSync(personaFile, "utf8");
        if (data) {
          personaData = JSON.parse(data);
        }
      }

      const userID = event.senderID;
      let userPersona = personaData.find((entry) => entry[userID]);

      if (!userPersona) {
        userPersona = { [userID]: 0 };
        personaData.push(userPersona);
      }

      const responseContent = await handleApiCall(api, query, userName, userPersona[userID]);

      // Reply to the original message using the messageID
      return api.sendMessage({
        body: responseContent,
        attachment: event.attachments, // Include any attachments from the original message if needed
      }, event.threadID, event.messageID);
    } catch (error) {
      console.error(error);
      if (error.response && error.response.data) {
        // Reply with an error message including the messageID
        return api.sendMessage(error.response.data, event.threadID, event.messageID);
      } else {
        // Reply with a generic error message including the messageID
        return api.sendMessage("An error occurred", event.threadID, event.messageID);
      }
    }
  },
};

